export class Drug {
    constructor(id, name, price, description, sideEffect, pharmacy) {
      this.id = id;
      this.name = name;
      this.price = price;
      this.description = description;
      this.sideEffect = sideEffect;
      this.pharmacy = pharmacy;
    }
  }
